import React, { useEffect, useState } from 'react'
import { Route, Routes } from 'react-router-dom'
import {  EditAdmin, ShowAdmins, NewAdmin } from './adminActions'

export default function Admins() {
  // var adminList=[]
  let result =[]
  let [adminList,setAdminList]=useState([])

  function FetchAdmins(){
      let request= fetch('http://127.0.0.1:5000/token:qwhu67fv56frt5drfx45e/admins',{
      method : "GET",
    }
    ).then(response=>response.json()).then(resp=>console.log(resp))

    console.log("request")

    result=request
    console.log(result)

    useEffect(() => {
      setAdminList(result)
    }, [])



  }

  setInterval(FetchAdmins(),60000)
  // setInterval({setAdminList(result)})

  return (
    <Routes>
        <Route exact path="/" element={<ShowAdmins adminList={adminList}/>} />
        <Route path="/edit/" element={<EditAdmin/>} />
        <Route path="/new/" element={<NewAdmin/>} />


      </Routes>
        )
}
